import { TableCell, TableRow } from "@material-ui/core"
import { Skeleton } from "@material-ui/lab"
import { BiSad } from "react-icons/bi"
import styled from "styled-components"

const LoadingCell = () => (
    <TableCell><Skeleton animation="wave" /></TableCell>
)

const LoadingRow = ({ col }) => (
    <TableRow>
        {[...Array(col).keys()].map(() => <LoadingCell />)}
    </TableRow>
)

export const LoadingRows = ({ col }) => (
    <>
        <LoadingRow col={col} />
        <LoadingRow col={col} />
        <LoadingRow col={col} />
        <LoadingRow col={col} />
    </>
)

const Wrapper = styled.div`
    height:250px;
    justify-content:center;
    align-items:center;
    display:flex;
    flex-direction:column;
`

export const EmptyRow = ({ error, suberror, redirect }) => (
    <TableCell colSpan="100%">
        <Wrapper >
            <BiSad className="text-secondary" size="70px" />
            <h3 style={{ fontSize: "25px" }} className="section-title m-0">
                Không tìm thấy môn học!
        </h3>
            <p className="text-secondary">
                Không tồn tại môn học đang tìm, vui lòng kiểm tra lại hoặc&nbsp;
            <Link to="/course/create">
                    tạo mới!
            </Link>
            </p>
        </Wrapper>
    </TableCell>
)
